import{_ as e,o,c as i,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 13.1-616 Fees for filing documents or issuing certificates.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-616.md","filePath":"vacode/13.1-616.md"}'),t={name:"vacode/13.1-616.md"},a=r('<h1 id="§-13-1-616-fees-for-filing-documents-or-issuing-certificates" tabindex="-1">§ 13.1-616 Fees for filing documents or issuing certificates. <a class="header-anchor" href="#§-13-1-616-fees-for-filing-documents-or-issuing-certificates" aria-label="Permalink to &quot;§ 13.1-616 Fees for filing documents or issuing certificates.&quot;">​</a></h1><p>The Commission shall charge and collect the following fees, except as provided in § <a href="/vacode/12.1-21.2/">12.1-21.2</a>:</p><ol><li><p>For filing of articles of conversion to convert a corporation to an eligible entity, the fee shall be $100.</p></li><li><p>For filing any one of the following, the fee shall be $25:</p></li></ol><p>a. Articles of incorporation or domestication.</p><p>b. Articles of conversion to convert an eligible entity to a corporation.</p><p>c. Articles of amendment or restatement.</p><p>d. Articles of merger or share exchange.</p><p>e. Articles of correction.</p><p>f. Articles of ratification.</p><p>g. An application of a foreign corporation for a certificate of authority to transact business in the Commonwealth.</p><p>h. An application of a foreign corporation for an amended certificate of authority to transact business in the Commonwealth.</p><p>i. A copy of an amendment of the articles of incorporation of a foreign corporation holding a certificate of authority to transact business in the Commonwealth.</p><p>j. A copy of articles of merger of a foreign corporation holding a certificate of authority to transact business in the Commonwealth.</p><p>k. A copy of an instrument of conversion of a foreign corporation holding a certificate of authority to transact business in the Commonwealth.</p><p>l. An application to register or to renew the registration of a corporate name.</p><ol start="3"><li>For filing any one of the following, the fee shall be $10:</li></ol><p>a. An application to reserve or to renew the reservation of a corporate name.</p><p>b. A notice of transfer of a reserved corporate name.</p><p>c. An application for use of an indistinguishable name.</p><p>d. Articles of dissolution.</p><p>e. Articles of revocation of dissolution.</p><p>f. Articles of termination of corporate existence.</p><p>g. An application for a certificate of withdrawal of a foreign corporation.</p><p>h. A notice of release of a registered name.</p><ol start="4"><li>For issuing a certificate pursuant to § <a href="/vacode/13.1-781/">13.1-781</a>, the fee shall be $6.</li></ol><p>Code 1950, §§ 13-18, 13.1-123, 13.1-124.1; 1956, c. 428; 1958, c. 564; 1964, c. 551; 1972, c. 579; 1975, c. 500; 1981, c. 522; 1982, c. 460; 1984, c. 294; 1985, c. 522; 1988, c. 405; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0368" target="_blank" rel="noreferrer">368</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0545" target="_blank" rel="noreferrer">545</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0001" target="_blank" rel="noreferrer">1</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0274" target="_blank" rel="noreferrer">274</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0765" target="_blank" rel="noreferrer">765</a>; 2007, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0771" target="_blank" rel="noreferrer">771</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0810" target="_blank" rel="noreferrer">810</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0130" target="_blank" rel="noreferrer">130</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0734" target="_blank" rel="noreferrer">734</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1226" target="_blank" rel="noreferrer">1226</a>.</p>',26),n=[a];function c(l,f,s,p,g,h){return o(),i("div",null,n)}const m=e(t,[["render",c]]);export{u as __pageData,m as default};
